import React, { Component } from "react";
import "./Addtodos.css";

class Addtodos extends Component {
  z;
  render() {
    const { handleSubmit, handleChange, content } = this.props;
    return (
      <div>
        <form onSubmit={handleSubmit} className="row">
          <div className="col s12 m8 l10">
            <label>Add new todo: </label>
            <input type="text" className="white-text" onChange={handleChange} value={content} />
          </div>
          <button
            className="col s12 m4 l2 waves-effect waves-light btn-large"
            onSubmit={handleSubmit}
          >
            Add
          </button>
        </form>
      </div>
    );
  }
}

export default Addtodos;
